KoUnicodeBlockData KoUnicodeBlockDataFactory::blockForUCS(QChar codepoint)
{
    for (int i = 0; i < d->blockMap.size(); i++) {
        KoUnicodeBlockData block = d->blockMap.at(i);
        if (block.match(codepoint)) {
                return block;
        }
    }
    return noBlock();
}